import React from "react"
export default function App()
{
    const [value, setValue] = React.useState(0);
    function plus()
    {
        setValue((prevVal) => {return(prevVal + 1)});
    }

    function minus()
    {
        setValue((prevVal) => {return(prevVal - 1)});
    }

    return(
        <div>
             <h1>
                {value}
            </h1>
            <button onClick={plus}>+</button>
            <button onClick={minus}>-</button>
        </div>
    );
}
